import React from 'react';

import { skills } from './consts';
import { TextProgress } from './style';
import { Notifications } from './Noficitaions';


export const Main = () => {

  return (
    <>
      {skills.map((skill) => <TextProgress key={skill.title} color={skill.color} progress={skill.progress}>{skill.title}</TextProgress>)}
      <Notifications />
    </>
  );
};
